<script>
for (let g of document.getElementsByTagName('g')) {
  g.children[0].addEventListener('click', (e) => {
    console.log(g.style.fill);
    if (g.style.fill.includes('255')) {
      g.style.fill = '#0e0';
    } else if (g.style.fill.includes('238')) {
      g.style.fill = '#00d';
    } else if (g.style.fill.includes('221')) {
      g.style.fill = 'rgb(34,34,34)';
    } else {
      g.style.fill = '#f00';
    }
  });
}

window.addEventListener('keydown', (e) => {
  if (e.key.toLowerCase() === 's') {
    copy2clipboard(document.body.innerHTML);
    alert('copied to clipboard');
  }
});

function copy2clipboard(str) {
  const el = document.createElement('textarea');
  el.value = str;
  document.body.appendChild(el);
  el.select();
  document.execCommand('copy');
  document.body.removeChild(el);
};
</script>
